import React, { useState } from "react";
import styled from "styled-components";
import { NavLink } from "react-router-dom";
const Section = styled.div`
  display: flex;
  justify-content: center;

  @media only screen and (max-width: 768px) {
    width: 80%;
  }
`;

const Container = styled.div`
  width: 80%;
  max-width: 1400px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px;

  @media only screen and (max-width: 768px) {
    flex-direction: column;
    align-items: flex-start;
    padding: 10px 20px;
  }
`;

const Links = styled.div`
  display: flex;
  align-items: center;
  gap: 50px;
`;

const Logo = styled.div`
  color: white;
  font-size: 18px;
  cursor: pointer;
  text-decoration: none;
`;

const List = styled.ul`
  display: flex;
  gap: 40px;
  list-style: none;

  List:hover {
    transform: translateY(10%) l;
  }

  @media only screen and (max-width: 768px) {
    display: ${(props) => (props.open ? "flex" : "none")};
    flex-direction: column;
    gap: 20px;
    position: absolute;
    top: 80px;
    left: 0;
    width: 89%;
    padding: 20px;
    background-color: #da4ea2;
    z-index: 1;
  }
`;

const ListItem = styled.li`
  cursor: pointer;
  color: white;
`;

const Icons = styled.div`
  display: flex;
  align-items: center;
  gap: 20px;
  cursor: pointer;
`;

const Button = styled.button`
  width: 100px;
  padding: 10px;
  background-color: #da4ea2;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;

  @media only screen and (max-width: 768px) {
    display: none;
  }
`;

const Hamburger = styled.div`
  display: none;
  cursor: pointer;

  @media only screen and (max-width: 768px) {
    display: block;
    position: absolute;
    top: 15px;
    right: 40px;
    width: 30px;
    height: 25px;
    z-index: 2;

    div {
      width: 100%;
      height: 3px;
      background-color: white;
      margin: 5px 0;
      transition: all 0.3s ease;
    }
  }
`;

const Navbar = () => {
  const [open, setOpen] = useState(false);

  const toggleMenu = () => {
    setOpen(!open);
  };

  return (
    <Section>
      <Container>
        <Links>
          <Logo>
            <NavLink to="/">
              <h2>Code School</h2>
            </NavLink>
          </Logo>
          <List open={open}>
            <ListItem>Home</ListItem>
            <ListItem>About Us</ListItem>
            <ListItem>Privacy Policy</ListItem>
            <ListItem>Terms and Coditions</ListItem>
            <ListItem>Disclaimer</ListItem>
            <ListItem>Contact Us</ListItem>
          </List>
        </Links>
        <Icons>
          <Button>Login</Button>
          <Hamburger onClick={toggleMenu}>
            <div />
            <div />
            <div />
          </Hamburger>
        </Icons>
      </Container>
    </Section>
  );
};

export default Navbar;
